import React, { Component } from 'react'

export class DailyGoals extends Component {
    render() {
        const{ dailyTodos } = this.props;
        const displayGoals = dailyTodos.map(todo => {
            return(
                <div className="onedailygoal">
                    <div className="onedailygoalheading">
                        <h4>{todo.title} </h4>123
                    </div>
                </div> 
            )
        })
        return (
            <div className="onedailygoal">
                <div className="onedailygoalheading">
                <h4>test </h4>123
                </div>
            </div> 
        )
    }
}

export default DailyGoals
